Upon first entering her deceased uncle's antique shop, Emily encounters many familiar items from her visits there as a girl. Among them is a strange new object, an extensively annotated diary. Emily recognizes her uncle's handwriting and wonders why he would mark up such an attractive antique making it unsellable. As she interacts with the book, she realizes that it has an odd effect on her. The diary's power over her seems to be increasing and she must solve the puzzle of the mysterious book or be forever trapped under its spell.
